import React, {useState} from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import {Button, Col, Input, Menu, Row} from 'antd';
import Link from 'next/link'
import SkillCard from '../components/SkillCard'
import PropTypes from 'prop-types'
const mySql={
    skillTitle:'MySql',
    skillImage:'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSpibYV2CKSUmb31N84neb4sORfKDvRIWG5yw&usqp=CAU',
    skillAbility:'basic~Junior',
}
const java={
    skillTitle:'Java',
    skillImage:'data:image/png;base64,',
    skillAbility:'basic',
}
const javaScript={
    skillTitle:'JavaScript',
    skillImage:'https://blog.kakaocdn.net/dn/lRRAQ/btqyQMuNJ8k/08nvfyHHv97TV7TEar5Yrk/img.png',
    skillAbility:'junior~senior',
}
const typeScript={
    skillTitle:'TypeScript',
    skillImage:'https://img1.daumcdn.net/thumb/R800x0/?scode=mtistory2&fname=https%3A%2F%2Fblog.kakaocdn.net%2Fdn%2FlgZYH%2FbtqAcMGiCw2%2FmNJs4R5gjNrBOJ4qYmrTg1%2Fimg.jpg',
    skillAbility:'junior',
}
const node={
    skillTitle:'Node.js',
    skillImage:'https://usefulangle.com/img/thumb/nodejs.png',
    skillAbility:'basic~junior',
}
const react={
    skillTitle:'React',
    skillImage:'https://miro.medium.com/max/600/1*jnqXL4Q-iW0qxodFDTxyFQ.jpeg',
    skillAbility:'basic~junior',
}
const mongodb={
    skillTitle:'mongodb',
    skillImage:'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR9asRDthDxdLkfbnirNodJ4XAZsuwx8ok5rA&usqp=CAU',
    skillAbility:'basic',
}
const C={
    skillTitle:'C',
    skillImage:'https://blog.kakaocdn.net/dn/d5VJCC/btqy6TtwnLa/PZJRkDEagCFpMDi8Mr0Bs0/img.png',
    skillAbility:'basic',
}
const htmlCss={
    skillTitle:'HTML/CSS',
    skillImage:'https://img1.daumcdn.net/thumb/R800x0/?scode=mtistory2&fname=https%3A%2F%2Fblog.kakaocdn.net%2Fdn%2FHYxz2%2Fbtqzy6y1FrA%2FziifyVqfYQO4NhXpngxWrk%2Fimg.jpg',
    skillAbility:'Junior~Senior',
}
const sf={
    skillTitle:'Spring FrameWork',
    skillImage:'https://perfectacle.github.io/images/spring-di-v1/thumb.png',
    skillAbility:'junior'
}

const MiniGame = () => {
    const cl=useState(C)
    const mysql=useState(mySql)
    const js=useState(javaScript)
    const java=useState(java)
    const htmlcss=useState(htmlCss)
    const node=useState(node)
    const ts=useState(typeScript)
    const mongo=useState(mongodb)
    const react=useState(react)
    const sf=useState(sf)

    return(
        <AppLayout>
            <Head>
                <title>MiniGame</title>
            </Head>
            <h1 className="main-title">This is my portfolio </h1>
            <section className="gameSection">
                <div className="gical">
                    <Link href="http://ahah12k.cafe24.com/ptp2/"target="_blank" rel="noreferrer noopener">
                        <a><h2 className="gameTitle">Find your Breath(Origin) (Only mobile)</h2></a>
                    </Link>
                    <div className="explainPort">
                        <SkillCard setSkill={htmlcss}/>
                        <SkillCard setSkill={mysql}/>
                        <SkillCard setSkill={java}/>
                        <SkillCard setSkill={sf}/>
                        <h3>▼Changes to React▼</h3>
                        <SkillCard setSkill={react}/>
                        <SkillCard setSkill={node}/>
                        <SkillCard setSkill={ts}/>
                        <SkillCard setSkill={js}/>
                    </div>
                    <Link href="/lol"><a>Change to React Breath</a></Link>
                </div>
                <div className="lol">
                    <Link href="http://ahah12k.cafe24.com/ptp1/" target="_blank" rel="noreferrer noopener">
                        <a><h2 className="gameTitle">Find your LOL character</h2></a>
                    </Link>
                    <div className="explainPort">
                        <SkillCard/>
                        <SkillCard/>
                        <SkillCard/>
                        <SkillCard/>
                    </div>
                    <h2>it will be update to React or React+Typescript</h2>
                </div>
            </section>
        </AppLayout>
        )
};

AppLayout.propTypes = {
    setSkill: PropTypes.node.isRequired.object,
}

export default MiniGame;
